import React, { useState, useEffect } from "react";
import FieldMap from "../components/FieldMap";

export default function HistoryPage() {
  const demo = [
    // пример дня
{
  id: "d1",
  label: "2025-09-01",
  imageUrl: "data:image/jpeg;base64,",
  points: [
    { x: 10, y: 20, color: "red" },  // Верхний левый ряд зелени
    { x: 20, y: 30, color: "green" },  // Смещение вниз по ряду
    { x: 30, y: 25, color: "green" },  // Следующий ряд
    { x: 40, y: 35, color: "green" },
    { x: 50, y: 40, color: "yellow" },  // Центральная область
    { x: 60, y: 45, color: "green" },
    { x: 70, y: 50, color: "green" },  // Нижние ряды
    { x: 80, y: 55, color: "green" },
    { x: 90, y: 60, color: "green" }   // Правый край
  ],
},

    {
      id: "d2",
      label: "2025-09-02",  
      imageUrl:
        "data:image/jpeg;base64,",
      points: [
        { x: 25, y: 40, color: "red" },
        { x: 60, y: 60, color: "yellow" },
        { x: 75, y: 35, color: "red" },
      ],
    },
    {
      id: "d3",
      label: "2025-09-03",
      imageUrl:
        "data:image/jpeg;base64,",
      points: [
        { x: 15, y: 25, color: "green" },
        { x: 45, y: 45, color: "green" },
        { x: 65, y: 65, color: "yellow" },
        { x: 80, y: 30, color: "green" },
      ],
    },
  ];

  const [days] = useState(demo);
  const [selected, setSelected] = useState(days[0]);
  const [fadeIn, setFadeIn] = useState(false);

  useEffect(() => {
    setFadeIn(false);
    const t = setTimeout(() => setFadeIn(true), 100);
    return () => clearTimeout(t);
  }, [selected]);

  return (
    <div
      className={`container history-container fade-in ${
        fadeIn ? "visible" : ""
      }`}
    >
      <h2 className="slide-in-top">История анализов</h2>
      <div className="history-grid">
        <aside className="history-aside card slide-in-left">
          <h4 className="slide-in-top delay-1">Дни</h4>
          <div className="days-list">
            {days.map((d, index) => (
              <div
                key={d.id}
                className={`day-row ${
                  selected.id === d.id ? "active" : ""
                } pop-in delay-${index + 2}`}
                onClick={() => setSelected(d)}
              >
                <div>{d.label}</div>
                <div className="muted small">{d.points.length}</div>
              </div>
            ))}
          </div>
        </aside>

        <section className="history-main slide-in-right">
          <FieldMap imageUrl={selected.imageUrl} points={selected.points} />
          <div className="card note fade-in visible">
            <h4 className="slide-in-top">Описание</h4>
            <p className="muted slide-in-left delay-1">
              Красный — серьёзные проблемы (засуха, болезнь). Жёлтый — требует
              внимания. Зелёный — всё в порядке.
            </p>
          </div>
        </section>
      </div>
    </div>
  );
}
